import React from 'react';

import './rosters.styles.scss';

export const Rosters = ({team, userTeam, opponentTeam}) =>{
    return (
        <div className='rosters'>
        <table id='roster'>
        <tr>
        <th>Position</th><th>Player</th></tr>
            {team==='user' ? 
            Object.keys(userTeam).map(ele=><tr><td>{ele}</td><td>{userTeam[ele]['name']}<span>&#8722;</span></td></tr>) : 
            Object.keys(opponentTeam).map(ele=><tr><td>{ele}</td><td>{opponentTeam[ele]['name']} <span>&#8722;</span></td></tr>)}
        </table>
        </div>
    )
}
